import React from "react";
import { createNativeStackNavigator } from "@react-navigation/native-stack";

import SecondScreen from "../screens/SecondScreen";
import MainTabs from "./MainTabs";

const Services = createNativeStackNavigator();
const Serv = () => {
  return (
    <Services.Navigator
      screenOptions={{
        headerShown: false,
      }}
    >
      <Services.Screen name="Pedreiros" component={MainTabs} />
      <Services.Screen name="Designers" component={SecondScreen} />
      <Services.Screen name="Cuidadores" component={MainTabs} />
      <Services.Screen name="Pintores" component={SecondScreen} />
    </Services.Navigator>
  );
};

export default Serv;
